import React from 'react'

function ListItem({listItem, setSelectedItem, selectedItem}) {
    handleClick = (id)=>{
        setSelectedItem(listItem.filter(item=>item.id==id))
    }
  return (
    <div>
        {
            listItem.map(item=>{
                return <div key={item.id} onClick={()=>handleClick(item.id)}>
                    <p>{item.email}</p>
                </div>
            })
        }
    </div>
  )
}

export default ListItem
